import styled from 'styled-components';

const Styled = styled.img`
  background: url(olympic_barbell.svg);
  height: 300px;
  width: 300px;
`;

const Barbell = () => {
  return <Styled className='barbell' src='olympic_barbell.svg' alt='barbell' />;
};

export default Barbell;
